import React, { useEffect } from 'react';
import { Link, Route, BrowserRouter as Router, Switch } from 'react-router-dom';
import ConnectionPage from './pages/connection-page';
import StudentsList from './pages/students-list-page';
import RegisterPage from './pages/register-page';
import StudentRegistration from './pages/student-register-page';
import StudentEdition from './pages/student-edit-page';
import ConnectedAccount from './models/ConnectedAccount';
import ProfilEdition from './pages/profil-edition-page';
import AccountList from './pages/account-list-page';
import ApiAccess from './services/api-access';
import Account from './models/Account';

const App: React.FC = () => {

    useEffect(() => {
        if(ConnectedAccount.id) {
            ConnectedAccount.fillFields(new Account())
        }
    }, []);

    const LogoutManagement = () => {
        ApiAccess.logout();
    }

    const ClearBase = () => {
        ApiAccess.clearBase();
    }

    return (
        <Router>
            <div>
                <nav>
                    {ConnectedAccount.role.includes("ADMIN") ? (
                        <div className="nav-wrapper teal">
                            <Link to="/student/registration" className="left"><i className="right material-icons">add_box</i>Ajout étudiant</Link>
                            <p className="left" onClick={ClearBase}><i className="right material-icons">delete_sweep</i>Vider la base</p>
                            <Link to="/students" className="brand-logo center">Students App</Link>
                            <Link to="/account/list" className="right"><i className="right material-icons">list</i>{ConnectedAccount.username}</Link>
                            <Link to="/profil" className="right"><i className="right material-icons">account_circle</i>{ConnectedAccount.username}</Link>
                            <p className="right" onClick={LogoutManagement}><i className="right material-icons">exit_to_app</i>Deconnexion</p>
                        </div>
                    ) : ConnectedAccount.role === "" ? (
                        <div className="nav-wrapper teal">
                            <Link to="/students" className="brand-logo center">Students App</Link>
                            <Link to="/register" className="right"><i className="right material-icons">person_add</i>   S'enregistrer</Link>
                            <Link to="/login" className="right"><i className="right material-icons">input</i>Se connecter</Link>
                        </div>
                    ) : (
                        <div className="nav-wrapper teal">
                            <Link to="/student/registration" className="left"><i className="right material-icons">add_box</i>Ajout étudiant</Link>
                            <Link to="/students" className="brand-logo center">Students App</Link>
                            <Link to="/profil" className="right"><i className="right material-icons">account_circle</i>{ConnectedAccount.username}</Link>
                            <p className="right" onClick={LogoutManagement}><i className="right material-icons">exit_to_app</i>Deconnexion</p>
                        </div>
                    )}
                </nav>
                <Switch>
                    <Route exact path="/" component={StudentsList} />
                    <Route exact path="/students" component={StudentsList} />
                    <Route exact path="/login" component={ConnectionPage} />
                    <Route exact path="/register" component={RegisterPage} />
                    <Route exact path="/student/registration" component={StudentRegistration} />
                    <Route exact path="/student/edition" component={StudentEdition} />
                    <Route exact path="/profil" component={ProfilEdition} />
                    <Route exact path="/account/list" component={AccountList} />
                </Switch>
            </div>
        </Router>
    )
}

export default App;
